def empirical_null(z, nmids=150, pct=-0.01, pct0=0.25, df=7):
    '''Estimate f(z) and f_0(z) using a polynomial approximation to Efron (2004)'s method.'''
    N = len(z)
    med = np.median(z)
    lb = med + (1 - pct) * (z.min() - med)
    ub = med + (1 - pct) * (z.max() - med)

    breaks = np.linspace(lb, ub, nmids+1)
    zcounts = np.histogram(z, bins=breaks)[0]
    mids = (breaks[:-1] + breaks[1:])/2

    # Splines
    #quantiles = np.percentile(mids, np.linspace(0, 1, df+1)[1:-1] * 100)
    #splrep(mids, zcounts, t=quantiles, s=0)

    ### Truncated Polynomial

    # Truncate to [-3, 3]
    selected = np.logical_and(mids >= -3, mids <= 3)
    zcounts = zcounts[selected]
    mids = mids[selected]

    # Form a polynomial basis and multiply by z-counts
    X = np.array([mids ** i for i in xrange(df+1)]).T
    beta0 = np.zeros(df+1)
    loglambda_loss = lambda beta, X, y: -((X * y[:,np.newaxis]).dot(beta) - np.exp(X.dot(beta))).sum()
    results = fmin_bfgs(loglambda_loss, beta0, args=(X, zcounts))
    a = np.linspace(-3,3,1000)
    B = np.array([a ** i for i in xrange(df+1)]).T
    beta_hat = results

    # Back out the mean and variance from the Taylor terms
    x_max = mids[np.argmax(X.dot(beta_hat))]
    loglambda_deriv1_atmode = np.array([i * beta_hat[i] * x_max**(i-1) for i in xrange(1,df+1)]).sum()
    loglambda_deriv2_atmode = np.array([i * (i-1) * beta_hat[i] * x_max**(i-2) for i in xrange(2,df+1)]).sum()
    
    sigma_enull = np.sqrt(-1.0/loglambda_deriv2_atmode)
    mu_enull = x_max - loglambda_deriv1_atmode/loglambda_deriv2_atmode

    return (mu_enull, sigma_enull)
